import React from "react";
import Modal from "../Modal";

const StreamDelete = () => {
  return (
    <div>
      <h2>StreamDelete</h2>
      <Modal
        title="Stream Delete"
        content="Are you sure to delete this stream?"
      />
    </div>
  );
};

export default StreamDelete;
